const LukeForm = () => {
    return (
        <><div>LukeForm</div><div>
            <label htmlFor="">Search for:</label>
            <select name="" id="">
                <option value="">Persons</option>
                <option value="">Planets</option>
            </select>
        </div></>
    )
}

export default LukeForm
